/*Table structure for table `tst_order` */

DROP TABLE IF EXISTS `tst_order`;

CREATE TABLE `tst_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `merchants_id` varchar(50) DEFAULT NULL,
  `member_id` varchar(50) DEFAULT NULL,
  `order_no` varchar(50) DEFAULT NULL COMMENT '订单号',
  `invoice_rise` varchar(10) DEFAULT NULL COMMENT '发票抬头',
  `invise_bank_code` varchar(100) DEFAULT NULL,
  `invise_bank_name` varchar(100) DEFAULT NULL,
  `invoice_rise_type` varchar(255) DEFAULT NULL,
  `invise_ticket_phone` varchar(100) DEFAULT NULL,
  `invise_register_time` varchar(100) DEFAULT NULL,
  `invise_register_phone` varchar(100) DEFAULT NULL,
  `invise_taxpayer_code` varchar(100) DEFAULT NULL,
  `invise_ticket_email` varchar(100) DEFAULT NULL,
  `invoice_price` decimal(10,0) DEFAULT NULL,
  `invoice_company_name` varchar(255) DEFAULT NULL COMMENT '发票抬头是 单位时， 所需要的单位名称',
  `invoice_type` varchar(255) DEFAULT NULL COMMENT '发票类型 1-不开票 2-纸质发票（个人，单位），3-增值税发票',
  `invoice_content` varchar(255) DEFAULT NULL COMMENT '发票内容',
  `address_id` varchar(50) DEFAULT NULL,
  `mobile` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `province` varchar(50) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `district` varchar(50) DEFAULT NULL,
  `detailed_address` varchar(50) DEFAULT NULL,
  `zip_code` varchar(50) DEFAULT NULL,
  `order_state` varchar(50) DEFAULT NULL COMMENT '订单状态  cancel：取消 wait_correction 待商家确认订单 wait_pay:待付款  wait_send:带发货  wait_receive：待确认收货 wait_assessment：待评价 end：已结束  wait_group_buy：等待团购人数满',
  `create_time` varchar(50) DEFAULT NULL,
  `is_delete` int(11) DEFAULT '0' COMMENT '是否删除 0：未  1：删除',
  `remark` varchar(255) DEFAULT NULL,
  `assessment_state` varchar(50) DEFAULT '0' COMMENT '评价店铺的状态:0未评价 1评价  ',
  `order_total_price` decimal(10,2) DEFAULT '0.00' COMMENT '订单总价',
  `order_pay_no` varchar(255) DEFAULT NULL COMMENT 'ping++返回的支付订单号',
  `order_type` varchar(255) DEFAULT 'goods' COMMENT '订单类型  goods:普通商品    time_limit:促销商品  group_buy:团购',
  `member_group_buy_id` varchar(255) DEFAULT NULL COMMENT '用户参与的团购id',
  `label_ids` varchar(255) DEFAULT NULL,
  `give_integral_value` decimal(10,2) DEFAULT '0.00',
  `logistics_no` varchar(255) DEFAULT NULL COMMENT '物流单号',
  `is_deduct_integral` varchar(10) DEFAULT NULL COMMENT '是否抵扣积分',
  `deduct_integral_value` varchar(10) DEFAULT NULL COMMENT '抵扣多少积分',
  `deduct_integral_price` decimal(10,2) DEFAULT '0.00',
  `deduct_integral_percent` varchar(255) DEFAULT NULL COMMENT '抵扣现金的百分比',
  `member_coupon_id` varchar(255) DEFAULT NULL COMMENT '用户优惠券id',
  `coupon_full_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠卷 满多少优惠',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠卷优惠金额',
  `is_free_express` varchar(255) DEFAULT NULL COMMENT '是否免邮',
  `express_free_price` varchar(255) DEFAULT NULL COMMENT '满多少免邮',
  `express_price` decimal(10,2) DEFAULT '0.00' COMMENT '邮费',
  `refund_price` decimal(10,2) DEFAULT '0.00',
  `refund_deduct_integral` varchar(255) DEFAULT NULL,
  `refund_give_integral` varchar(255) DEFAULT NULL,
  `refund_coupon_id` varchar(255) DEFAULT NULL,
  `pay_way` varchar(255) DEFAULT NULL COMMENT '支付方式：',
  `pay_way_name` varchar(255) DEFAULT NULL COMMENT '支付方式名称',
  `temporary_pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '订金',
  `delivery_way` varchar(255) DEFAULT NULL COMMENT '送货方式， 1- 快递  2- 上门自取',
  `order_charge` varchar(5000) DEFAULT NULL,
  `logistics_pinyin` varchar(255) DEFAULT NULL,
  `is_profit` varchar(255) DEFAULT NULL COMMENT '是否已经分配收益',
  `assessment_time` varchar(50) DEFAULT NULL,
  `business_id` int(11) DEFAULT NULL,
  `merchants_account_id` int(11) DEFAULT NULL,
  `order_actual_price` decimal(10,2) DEFAULT '0.00',
  `receive_time` varchar(50) DEFAULT NULL,
  `send_time` varchar(50) DEFAULT NULL,
  `invise_register_address` varchar(255) DEFAULT NULL COMMENT '注册地址',
  `order_source_way` varchar(255) DEFAULT 'goods' COMMENT '订单来源方式   goods:商品   recharge:充值',
  `cross_border_tax` varchar(255) DEFAULT NULL,
  `member_discount_price` decimal(10,2) DEFAULT '0.00',
  `since_id` varchar(255) DEFAULT NULL COMMENT '自提点id',
  `since_name` varchar(255) DEFAULT NULL COMMENT '自提点名称',
  `since_mobile` varchar(255) DEFAULT NULL COMMENT '自提点手机号',
  `since_fixed_mobile` varchar(255) DEFAULT NULL COMMENT '自提点固定电话',
  `since_people_name` varchar(255) DEFAULT NULL COMMENT '自提人姓名',
  `custom_remark` text COMMENT '后台客服做备注',
  `exempt_need_count` varchar(255) DEFAULT NULL COMMENT '减免需要数量',
  `exempt_count` varchar(255) DEFAULT NULL COMMENT '减免数量',
  `exempt_price` varchar(255) DEFAULT NULL COMMENT '减免钱',
  `is_add` varchar(255) DEFAULT NULL COMMENT '是否递增',
  `reduce_need_price` decimal(10,2) DEFAULT '0.00' COMMENT '抵扣需要钱',
  `reduce_price` decimal(10,2) DEFAULT '0.00' COMMENT '抵扣钱',
  `activity_type` varchar(10) DEFAULT NULL COMMENT '活动类型',
  `is_send` varchar(255) DEFAULT '0' COMMENT '是否推送',
  `pay_time` varchar(50) DEFAULT NULL,
  `yc_time` varchar(50) DEFAULT NULL,
  `order_response` varchar(255) DEFAULT NULL,
  `pay_no` varchar(255) DEFAULT NULL COMMENT '实际支付请求的订单号',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=285 DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `tst_order` */


