/*Table structure for table `tst_work_order` */

DROP TABLE IF EXISTS `tst_work_order`;

CREATE TABLE `tst_work_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '工单主键',
  `order_member_id` int(11) NOT NULL COMMENT '预约者id（外键）',
  `order_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '姓名',
  `order_state` int(255) DEFAULT '16' COMMENT '工单当前状态',
  `order_phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '联系电话',
  `order_address_country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '中国' COMMENT '预约地址国家',
  `order_address_province` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约地址省',
  `order_address_city` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约地址市',
  `order_address_district` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约地址县',
  `order_address_detail` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约详细地址',
  `order_address_longitude` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约地址经度',
  `order_address_latitude` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约地址纬度',
  `order_subscribe_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '服务内容',
  `order_subscribe_note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约备注',
  `order_subscribe_img1` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约现场图片1',
  `order_subscribe_img2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约现场图片2',
  `order_subscribe_img3` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预约现场图片3',
  `order_hope_service_time` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '期望服务时间',
  `order_create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `order_update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `order_audit_pass_time` datetime DEFAULT NULL COMMENT '预约审核通过时间',
  `order_accept_id` int(11) DEFAULT NULL COMMENT '接单人id',
  `order_accept_time` datetime DEFAULT NULL COMMENT '接单时间',
  `order_cancle_why` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '退单原因',
  `order_cancle_time` datetime DEFAULT NULL COMMENT '退单时间',
  `order_cancle_pass_time` datetime DEFAULT NULL COMMENT '退单审核通过时间',
  `order_reality_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '实际服务内容',
  `order_complete_img1` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '完工图片1',
  `order_complete_img2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '完工图片2',
  `order_complete_img3` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '完工图片3',
  `order_complete_note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '完工备注',
  `order_service_time` datetime DEFAULT NULL COMMENT '上门服务时间',
  `order_complete_time` datetime DEFAULT NULL COMMENT '完工时间',
  `order_complete_pass_time` datetime DEFAULT NULL COMMENT '完工审核通过时间',
  `order_is_delete` int(11) DEFAULT '0' COMMENT '是否删除',
  `order_class_id` int(11) DEFAULT NULL COMMENT '工单所属类别',
  `order_is_cancle` int(11) DEFAULT '0' COMMENT '是否已退单',
  `order_service_attitude` int(11) DEFAULT NULL COMMENT '服务态度',
  `order_service_aging` int(11) DEFAULT NULL COMMENT '服务时效',
  `order_sercice_quality` int(11) DEFAULT NULL COMMENT '服务质量',
  `order_evaluate_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '评价内容',
  `order_price` decimal(10,2) DEFAULT '0.00' COMMENT '订单金额',
  `complaints_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '投诉内容',
  `complaints_time` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '投诉时间',
  `is_complaints` varchar(1) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT '是否投诉',
  `is_lock` varchar(1) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT '是否被客服锁住',
  `lock_id` int(11) DEFAULT NULL COMMENT '锁单客服id',
  `deposit_price` decimal(10,2) DEFAULT NULL COMMENT '预约缴纳押金金额',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=306 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='师傅工单（用户预约）';

