/* Procedure structure for procedure `wk` */

/*!50003 DROP PROCEDURE IF EXISTS  `wk` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `wk`()
BEGIN
DECLARE i INT DEFAULT 1;
WHILE i<(select count(order_id) from tst_work_order) DO
UPDATE tst_work_order SET order_id=i where order_id=i;
SET i=i+1;
END WHILE;
END */$$
DELIMITER ;

